import React from 'react'
import { Box, BottomNavigation, BottomNavigationAction } from "@material-ui/core"
import { AddCircleSharp, CreateSharp, SearchSharp, DeleteSharp } from "@material-ui/icons"

const [value, setValue] = ['test1', 'test2']
class Item extends React.Component {


    render(){
        return (
          <Box sx={{ width: 500 }}>
            <BottomNavigation
              showLabels
              value={value}

              onChange={(event, newValue) => {
                setValue(newValue);
              }}
            >
              <BottomNavigationAction 
                label="제품 추가" 
                icon={<AddCircleSharp />} />
              <BottomNavigationAction
                label="제품 검색"
                icon={<SearchSharp />}
              />
              <BottomNavigationAction
                label="제품 수정"
                icon={<CreateSharp />}
              />
              <BottomNavigationAction
                label="제품 삭제"
                icon={<DeleteSharp />}
              />
            </BottomNavigation>
          </Box>
        );
    }
}

export default Item;
